import React from "react";

import Box from "@material-ui/core/Box";

const AStepperFormPart = (props) => {
  let stepNum;
  if (stepNum === 0) {
    const stepNum = props.add_step(props.title);
    console.log("step number: " + stepNum);
  }

  let boxProps = {};
  console.log("step number: " + stepNum);
  if (stepNum > 1) {
    boxProps.style = { display: "none" };
    console.log("boxProp: " + JSON.stringify(boxProps));
  }

  return <div {...boxProps}>{props.children}</div>;
};

export default AStepperFormPart;
